e ECG signal is not displayed at the indicated recording speed and/or amplitude resolution.','\0','','CL-EGSTRESC','DBX-NCIT-C114168'),('CL-EGSTRESC-T-69',NULL,'INDETERMINATE QRS AXIS','An electrocardiographic finding in which the frontal plane QRS axis cannot be calculated.','\0','Indeterminate Axis; Indeterminate QRS Axis; QRS Axis Indeterminate','CL-EGSTRESC','DBX-NCIT-C102701'),('CL-EGSTRESC-T-7',NULL,'ABERRANTLY CONDUCTED COMPLEXES','An electrocardiographic finding of abnormal wide QRS complex(es) of supraventricular in origin and wide due to aberrant AV conduction.','\0','Aberrantly Conducted Beats','CL-EGSTRESC','DBX-NCIT-C116132'),('CL-EGSTRESC-T-70',NULL,'INFERIOR WALL MYOCARDIAL INFARCTION','An electrocardiographic finding of pathologic Q waves in leads III, aVF and often II, which is suggestive of myocardial infarction of the inferior wall of the left ventricle.','\0','Inferior MI; Inferior Wall Myocardial Infarction','CL-EGSTRESC','DBX-NCIT-C35398'),('CL-EGSTRESC-T-71',NULL,'INSUFFICENT NUMBER OF BEATS TO COMPLETELY EVALUATE ECG','An electrocardiographic recording in which fewer than the required number of cardiac complexes are available for measurement and/or interpretation due to a shorter than planned recording or due to cardiac complexes which are present but are not suitable f','\0','','CL-EGSTRESC','DBX-NCIT-C114177'),('CL-EGSTRESC-T-72',NULL,'INTRAATRIAL CONDUCTION DELAY','An electrocardiographic finding of a delay in impulse propagation through the atria. This is characterized by broad P waves which are often biphasic in V1.','\0','Intraatrial Conduction Delay','CL-EGSTRESC','DBX-NCIT-C71073'),('CL-EGSTRESC-T-73',NULL,'INTRAVENTRICULAR CONDUCTION DELAY, NONSPECIFIC','An electrocardiographic finding of a widened QRS duration typically greater than 110 ms which does not meet the morphologic criteria for any of the standard bundle branch or fascicular block patterns.','\0','Intraventricular conduction delay; Intraventricular conduction delay, nonspecific','CL-EGSTRESC','DBX-NCIT-C62271'),('CL-EGSTRESC-T-74',NULL,'INVALID ECG WAVEFORMS','An electrocardiographic recording for which the displayed leads do not represent the individual\'s true ECG lead information.','\0','','CL-EGSTRESC','DBX-NCIT-C114171'),('CL-EGSTRESC-T-75',NULL,'ISORHYTHMIC DISSOCIATION','An electrocardiographic finding of a type of atrioventricular dissociation characterized by the atria (P waves) and ventricles (QRS complexes) beating at similar rates, although independently.','\0','Isorhythmic dissociation','CL-EGSTRESC','DBX-NCIT-C62248'),('CL-EGSTRESC-T-76',NULL,'J POINT ELEVATION','An electrocardiographic finding of a significant elevation above the baseline of the J point.','\0','J point elevation','CL-EGSTRESC','DBX-NCIT-C71030'),('CL-EGSTRESC-T-77',NULL,'JUNCTIONAL BRADYCARDIA','An electrocardiographic finding of a junctional rhythm with a heat rate which is abnormally low.','\0','Junctional bradycardia','CL-EGSTRESC','DBX-NCIT-C71074'),('CL-EGSTRESC-T-78',NULL,'JUNCTIONAL ESCAPE COMPLEXES','An electrocardiographic finding of an escape beat following a pause which originates in the AV junction. This is manifest as a QRS complex of supraventricular origin not preceded by a P wave.','\0','Junctional Escape Beats','CL-EGSTRESC','DBX-NCIT-C116129'),('CL-EGSTRESC-T-79',NULL,'JUNCTIONAL PREMATURE COMPLEX','An electrocardiographic finding of an ectopic impulse originating in the AV junction presenting as a QRS complex of supraventricular origin which is not preceded by a P wave.','\0','Junctional Extra Beat; Junctional Premature Complex; Junctional premature complex(es)','CL-EGSTRESC','DBX-NCIT-C102652'),('CL-EGSTRESC-T-8',NULL,'AC NOISE','An electrocardiographic recording showing power line interference with the electrocardiographic signal. The artifact amplitude modulation has the same frequency as the AC power system present (usually 50 Hz or 60 Hz).','\0','AC Noise','CL-EGSTRESC','DBX-NCIT-C114149'),('CL-EGSTRESC-T-80',NULL,'JUNCTIONAL RH