ressure after the contraction of the heart while the chambers of the heart refill with blood. (NCI)','\0','Diastolic Blood Pressure','CL-VSTESTCD','DBX-NCIT-C25299'),('CL-VSTESTCD-T-7',NULL,'FARMCIR','The distance around an individual\'s forearm.','\0','Forearm Circumference','CL-VSTESTCD','DBX-NCIT-C100946'),('CL-VSTESTCD-T-8',NULL,'FRMSIZE','The categorization of a person\'s body frame into small, medium and large based on the measurement of wrist circumference or the breadth of the elbow. (NCI)','\0','Body Frame Size','CL-VSTESTCD','DBX-NCIT-C49680'),('CL-VSTESTCD-T-9',NULL,'HDCIRC','A circumferential measurement of the head at the widest point.','\0','Head Circumference','CL-VSTESTCD','DBX-NCIT-C81255');
