INSERT INTO `DomainTemplates` VALUES ('D-CUST-CY','Cytometry Data','Assay Observations','A custom domain for collecting processed cytometry data, which is primarily about collecting observations about cells and populations of cells and their expression of certain markers','CY','One record per measured prameter per cell population (group) per biospecimen identifier','\0'),('D-CUST-HD','High dimensional assay data','Assay Observations','A custom domain for collecting processed high dimensional assay data, which is primarily about collecting observations about samples and their expression of certain markers','HD','One record per measured prameter per biospecimen identifier','\0'),('D-CUST-MX','Assay data matrix','Assay Observations','A simple template for a two dimensional data matrix used for array data or any other assay data that is represented in a matrix structure, where columns/rows are sample or feature identifiers and cells are single measurement values  (e.g. log intensity)','MX','A two dimensional data matrix with a single measurement for each feature/sample combination','\0'),('D-MAGE-ADF','Microarray Feature Annotation','Assay Feature Annotations','An ADF file describes the design of an array, e.g., what sequence is located at each position on an array and what the annotation of this sequence is. If the investigation uses arrays for which a description has been previously provided, such as a standard commercial array, cross-references to entries in a public repository (e.g., an Array Express accession number) can be included instead of explicit array descriptions.','ADF','An optional header section providing some top-level information about the array design. 2- Main section with one row per feature on the array describing what sequence is located at each position on an',''),('D-SDTM-AE','Adverse Events','Events','Adverse events may be captured either as free text or a pre-specified list of terms.','AE','One record per adverse event per subject','\0'),('D-SDTM-BS','Biospecimen Findings','Sample Annotations','A findings domain that contains the details regarding the characteristics of biospecimens and extracted samples (e.g., RNA, DNA) such as specimen volume, quantity of extracted sample, specimen condition and the integrity of the DNA or RNA samples.','BS','One record per measurement per biospecimen identifier per subject ','\0'),('D-SDTM-CE','Clinical Events','Events','A dataset used to capture clinical events of interest that would not be classified as adverse events','CE','One record per event per subject','\0'),('D-SDTM-CM','Concomitant Medications','Interventions','Case report form CRF data that captures the Concomitant and Prior Medications/Therapies used by the subject. Examples are the Concomitant Medications/Therapies given on an as needed basis and the usual Background Medications/Therapies given for a condition.','CM','One record per recorded medication occurrence or constant-dosing interval per subject','\0'),('D-SDTM-CO','Comments','SpecialPurpose','The Comments dataset accommodates two sources of comments: 1- those collected alongside other data on topical case report form CRF pages such as Adverse Events and 2- those collected on a separate page specifically dedicated to comments.','CO','One record per comment per subject','\0'),('D-SDTM-DA','Drug Accountability','Findings','Data regarding the accountability of study drug, such as information on the receipt, dispensing, return, and packaging.','DA','One record per drug accountability finding per subject','\0'),('D-SDTM-DD','Death Details','Findings','The domain is designed to hold supplemental data that are typically collected when a death occurs, such as the official cause of death. It does not replace existing data such as the SAE details in AE. Furthermore, it does not introduce a new requirement to collect information that is not already indicated as Good Clinical Practice or defined in regulatory guidelines. Instead, it provides a consistent place within SDTM to hold information that previously did not have a clearly defined home.','DD','One record per finding per subject','\0'),('D-SDTM-DM','Demographics','SpecialPurpose','The Demographics domain includes a set of essential standard variables that describe each subject in a clinical study. It is the parent domain for all other observations for human clinical subjects.','DM','One record per subject','\0'),('D-SDTM-DS','Disposition','Events','A subject domain utilized for the submission of information encompassing and representing data, vocabulary or records related to disposition. (NCI)','DS','One record per disposition status or protocol milestone per subject','\0'),('D-SDTM-DV','Protocol Deviations','Events','The intent of the domain is to capture protocol violations and deviations during the course of the study and will store only those criteria violation by or deviated from by the subject and not a response to each violation or deviation.','DV','One record per protocol deviation per subject','\0'),('D-SDTM-EG','ECG Test Results','Findings','Findings related to the collection of ECG data, including position of the subject, method of evaluation, all cycle measurements and all findings from the ECG including an overall interpretation if collected or derived.','EG','One record per ECG observation per time point per visit per subject','\0'),('D-SDTM-EX','Exposure','Interventions','The Exposure domain model records the details of a subject\'s exposure to protocol-specified study treatment. Study treatment may be any intervention that is prospectively defined as a test material within a study, and is typically but not always supplied to the subject.','EX','One record per constant dosing interval per subject','\0'),('D-SDTM-FA','Findings About Events or Interventions','FindingsAbout','A dataset used to capture the findings about an event or intervention that cannot be represented within an event or intervention record or as a supplemental qualifier.','FA','One record per finding per object per time point per time point reference per visit per subject','\0'),('D-SDTM-HO','Health Encounters','Events','The Healthcare Encounters dataset includes inpatient and outpatient healthcare events (e.g., hospitalizations, nursing home stay, rehabilitation facility stays, ambulatory surgery).','HO','One record per healthcare encounter per subject','\0'),('D-SDTM-IE','Inclusion/ Exclusion Criteria Not Met','Findings','The intent of the domain model is to only collect those criteria that cause the subject to be in violation of the inclusion/exclusion criteria not a response to each criterion.','IE','One record per inclusion/exclusion criterion not met per subject','\0'),('D-SDTM-IS','The Immunogenicity Specimen Assessments','Findings','It is intended to be used only for data collected regarding the immunogenic potential of materials under study.','IS','One record per test per visit per subject','\0'),('D-SDTM-LB','Laboratory Test Results','Findings','Laboratory test findings including, but is not limited to hematology, clinical chemistry and urinalysis data. This domain does not include microbiology or pharmacokinetic data, which are stored in separate domains.','LB','One record per analyte per planned time point number per time point reference per visit per subject','\0'),('D-SDTM-MB','Microbiology Specimen','Findings','Microbiology specimen findings, including gram stain results, and organisms found.','MB','One record per microbiology specimen finding per time point per visit per subject','\0'),('D-SDTM-MH','Medical History','Events','The medical history dataset includes the subject\'s prior history at the start of the trial. Examples of subject medical history information could include general medical history, gynecological history, and primary diagnosis.','MH','One record per medical history event per subject','\0'),('D-SDTM-MI','Microscopic Findings','Findings','Microbiology specimen findings, including gram stain results, and organisms found..','MI','One record per finding per specimen per subject','\0'),('D-SDTM-MO','Morphology','Findings','Macroscopic results (e.g. size, shape, color, and abnormalities of body parts or specimens) that are seen by the naked eye or observed via procedures such as imaging modalities, endoscopy, or other technologies. Many morphology results are obtained from a procedure, although information about the procedure may or may not be collected','MO','One record per Morphology finding per location per time point per visit per subject','\0'),('D-SDTM-MS','Microbiology Susceptibility','Findings','This includes microbiology susceptibility test results, plus results of any other organism-related tests','MS','One record per microbiology susceptibility test (or other organism-related finding) per organism found in MB','\0'),('D-SDTM-PC','Pharmacokinetic Concentrations','Findings','Concentrations of drugs/metabolites in fluids or tissues as a function of time.','PC','One record per analyte per planned time point number per time point reference per visit per subject','\0'),('D-SDTM-PE','Physical Examination','Findings','Findings collected during a physical examination of the subject. It has findings that are discovered that are related to body systems. Does not include vital signs measurements, which are stored in the vital signs domain.','PE','One record per body system or abnormality per visit per subject','\0'),('D-SDTM-PP','Pharmacokinetic Parameters','Findings','Pharmacokinetic parameters derived from pharmacokinetic concentration-time (PC) data.','PP','One record per PK parameter per time-concentration profile per modeling method per subject','\0'),('D-SDTM-QS','Questionnaire','Findings','Questionnaires are named, stand-alone instruments designed to provide an assessment of a concept. Questionnaires have a defined standard structure, format, and content; consist of conceptually related items that are typically scored; and have documented methods for administration and analysis.','QS','One record per questionnaire per question per time point per visit per subject','\0'),('D-SDTM-RE','Respiratory System Findings','Findings','A domain for physiological findings related to the respiratory system, including the organs that are involved in breathing such as the nose, throat, larynx, trachea, bronchi and lungs','RE','One record per finding or result per time point per visit per subject.','\0'),('D-SDTM-RELREC','Related Records','Relationship','','RELREC','One record per related record, group of records or datasets','\0'),('D-SDTM-RP','Reproductive System Findings','Findings','The Reproductive System Findings domain captures all Reproductive information related to a subject','RP','One record per Reproductive System Finding per time point per visit per subject','\0'),('D-SDTM-RS','Disease Response','Findings','A domain represents the response evaluation(s) determined from the data in TR. Data from other sources (in other SDTM domains) might also be used in an assessment of response.','RS','One record per response assessment per visit per subject per assessor','\0'),('D-SDTM-SC','Subject Characteristics','Findings','The subject characteristics domain is for data not collected in other domains that is subject-related.','SC','One record per characteristic per subject','\0'),('D-SDTM-SE','Subject Elements','SpecialPurpose','The subject element table describes the actual order of elements followed by the subject, together with the start date/time and end date/time for each element.','SE','One record per actual Element per subject','\0'),('D-SDTM-SR','Skin Response','FindingsAbout','The Skin Response (SR) is the first implementation of the Findings About concept that is Findings About an Intervention and uses a different domain code instead of FA','SR','One record per test per visit per subject','\0'),('D-SDTM-SS','Subjec Status','Findings','Subject Status is for data relating to general subject characteristics that are evaluated periodically to determine if they have changed.','SS','One record per finding per visit per subject','\0'),('D-SDTM-SU','Substance Use','Interventions','The intent of the domain is to capture substance use information that may be used to assess the efficacy and/or safety of therapies that look to mitigate the effects of chronic substance use.','SU','One record per substance type per reported occurrence per subject','\0'),('D-SDTM-SUPPQUAL','Supplemental Qualifiers','Relationship','','SUPP','One record per IDVAR, IDVARVAL, and QNAM value per subject','\0'),('D-SDTM-SV','Subject Visits','SpecialPurpose','The subject visits table describes the actual start and end data/time for each visit of each individual subject.','SV','One record per actual visit per subject','\0'),('D-SDTM-TA','Trial Arms','TrialDesignModel','The trial arms table describes each planned arm in the trial. An arm is described as an ordered sequence of elements.','TA','One record per planned Element per Arm','\0'),('D-SDTM-TE','Trial Elements','TrialDesignModel','The Trial Elements (TE) dataset contains the definitions of the elements that appear in the Trial Arms (TA) dataset. An Element may appear multiple times in the Trial Arms table because it appears either 1) in multiple Arms, 2) multiple times within an Arm, or 3) both. However, an Element will appear only once in the Trial Elements table.','TE','One record per planned Element','\0'),('D-SDTM-TI','Trial Inclusion/ Exclusion Criteria','TrialDesignModel','The Trial Inclusion Exclusion (TI) dataset is not subject oriented. It contains all the inclusion and exclusion criteria for the trial, and thus provides information that may not be present in the subject-level data on inclusion and exclusion criteria.','TI','One record per I/E criterion','\0'),('D-SDTM-TR','Tumor Results','Findings','Represents quantitative measurements and/or qualitative assessments of the tumors identified in the TU domain. These measurements are usually taken at baseline and then at each subsequent assessment to support response evaluations.','TR','One record per tumor measurement/assessment per visit per subject per assessor','\0'),('D-SDTM-TS','Trial Summary','TrialDesignModel','The Trial Summary (TS) dataset allows the sponsor to submit a summary of the trial in a structured format. Each record in the Trial Summary dataset contains the value of a parameter, a characteristic of the trial. For example, Trial Summary is used to record basic information about the study such as trial phase, protocol title, and trial objectives. The Trial Summary dataset contains information about the planned and actual trial characteristics.','TS','One record per trial summary parameter value','\0'),('D-SDTM-TU','Tumor Identification','Findings','domain represents data that uniquely identifies tumors. The tumors are identified by an investigator and/or independent assessor and classified according to the disease assessment criteria.','TU','One record per identified tumor per subject per assessor','\0'),('D-SDTM-TV','Trial Visits','TrialDesignModel','The Trial Visits (TV) dataset describes the planned Visits in a trial. Visits are defined as \"clinical encounters\" and are described using the timing variables VISIT, VISITNUM, and VISITDY. Protocols define Visits in order to describe assessments and procedures that are to be performed at the Visits.','TV','One record per planned Visit per Arm','\0'),('D-SDTM-VS','Vital Signs','Findings','Measurements including but not limited to blood pressure, temperature, respiration, body surface area, BMI, height and weight.','VS','One record per vital sign measurement per time point per visit per subject','\0');
/*!40000 ALTER TABLE `DomainTemplates` ENABLE KEYS */;
