d here, so the resource can be looked up via the URL in Term Source File.','string','Term Source Name','D-MAGE-ADF','CL-Role-T-5','CL-Compliance-T-3',NULL,9,'','','HEADER',NULL),('V-MAGE-ADF-REFURI','Term Source File','The URL where an external database resource mentioned in Term Source Name  is hosted.','string','Term Source File','D-MAGE-ADF','CL-Role-T-5','CL-Compliance-T-3',NULL,10,'','','HEADER',NULL),('V-MAGE-ADF-REFVER','Term Source Version','The version of the external database resource mentioned in Term Source Name  is hosted.','string','Term Source Version','D-MAGE-ADF','CL-Role-T-5','CL-Compliance-T-3',NULL,11,'','','HEADER',NULL),('V-MAGE-ADF-REPANN','Reporter Database Entry[<REFSRC>]','Annotation for Reporter. Cross-reference accession in external database. You can enter multiple accessions from the same database by separating them with semicolons, e.g. AJ12345;BX45678','string','Reporter Database Entry[<REFSRC>]','D-MAGE-ADF','CL-Role-T-3','CL-Compliance-T-2',NULL,21,'','','COLUMN','CL-FEATDBS'),('V-MAGE-ADF-REPCRL','Control Type','Type of Control the reporter represents','string','Control Type','D-MAGE-ADF','CL-Role-T-3','CL-Compliance-T-2',NULL,20,'','','COLUMN',NULL),('V-MAGE-ADF-REPGRP','Reporter Group[<Role>]','Defined role of the probe at this location. Can be experimental or control','string','Reporter Group[role]','D-MAGE-ADF','CL-Role-T-3','CL-Compliance-T-3',NULL,19,'','','COLUMN',NULL),('V-MAGE-ADF-REPNAM','Reporter Name','Unique probe or probset name','string','Reporter Name','D-MAGE-ADF','CL-Role-T-1','CL-Compliance-T-1',NULL,17,'','','COLUMN',NULL),('V-MAGE-ADF-ROW','Row','Row position for a spot on the array','positive integer','Row','D-MAGE-ADF','CL-Role-T-3','CL-Compliance-T-2',NULL,16,'','','COLUMN',NULL),('V-MAGE-ADF-SEQPLOY','Sequence Polymer Type','The polymer that makes up the probes.','string','Sequence Polymer Type','D-MAGE-ADF','CL-Role-T-3','CL-Compliance-T-2',NULL,8,'','','HEADER',NULL),('V-MAGE-ADF-SUBS','Substrate Type','The material/substrate of the microarray.','string','Substrate Type','D-MAGE-ADF','CL-Role-T-3','CL-Compliance-T-2',NULL,7,'','','HEADER',NULL),('V-MAGE-ADF-SURF','Surface Type','The chemical coating on the surface of the substrate see below. Probes are immobilised by the coating.','string','Surface Type','D-MAGE-ADF','CL-Role-T-3','CL-Compliance-T-2',NULL,6,'','','HEADER',NULL),('V-MAGE-ADF-TECH','Technology Type','Printing/synthesis technology used when creating the microarray.','string','Technology Type','D-MAGE-ADF','CL-Role-T-3','CL-Compliance-T-2',NULL,5,'','','HEADER',NULL),('V-MAGE-ADF-VER','Version','Version (or revision) number of the array design.','string','Version','D-MAGE-ADF','CL-Role-T-1','CL-Compliance-T-3',NULL,2,'','','HEADER',NULL),('V-SDTM-AE-AEACN','AEACN','Describes changes to the study treatment as a result of the event. AEACN is specifically for the relationship to study treatment. AEACNOTH is for actions unrelated to dose adjustments of study treatment. Examples of AEACN values include ICH E2B values: DRUG WITHDRAWN, DOSE REDUCED, DOSE INCREASED, DOSE NOT CHANGED, UNKNOWN or NOT APPLICABLE.','string','Action Taken with Study Treatment','D-SDTM-AE','CL-Role-T-3','CL-Compliance-T-2','CL-ACN',28,'\0','\0','COLUMN',NULL),('V-SDTM-AE-AEACNOTH','AEACNOTH','Describes other actions taken as a result of the event that are unrelated to dose adjustments of study treatment. Usually reported as free text. Example: \"TREATMENT UNBLINDED. PRIMARY CARE PHYSICIAN NOTIFIED.\"','string','Other Action Taken','D-SDTM-AE','CL-Role-T-3','CL-Compliance-T-3',NULL,29,'\0','\0','COLUMN',NULL),('V-SDTM-AE-AEBDSYCD','AEBDSYCD','Dictionary derived. Code for the body system or organ class used by the sponsor. When using a multi-axial dictionary such as MedDRA, this should contain the SOC used for the sponsor\'s analyses and summary tables, which may not necessarily be the primary SOC.','decimal','Body System or Organ Class Code','D-SDTM-AE','CL-Role-T-5','CL-Compliance-T-2',NULL,22,'\0','\0','COLUMN',NULL),('V-SDTM-AE-AEBODSYS','AEBODSYS','Dictionary derived. Body system or organ class used by the sponsor from the coding dictionary (e.g., MedDRA). When using a multi-axial dictionary such as MedDRA, this should contain the SOC used for the sponsor\'s analyses and summary tables which may not necessarily be the primary SOC.','string','Body System or Organ Class','D-SDTM-AE','CL-Role-T-3','CL-Compliance-T-2',NULL,21,'\0','\0','COLUMN',NULL),('V-SDTM-AE-AECAT','AECAT','Used to define a category of related records. Example: BLEEDING, NEUROPSYCHIATRIC.','string','Category for Adverse Event','D-SDTM-AE','CL-Role-T-7','CL-Compliance-T-3',NULL,18,'\0','\0','COLUMN',NULL),('V-SDTM-AE-AECONTRT','AECONTRT','Was another treatment given because of the occurrence of the event?','string','Concomitant or Additional Trtmnt Given','D-SDTM-AE','CL-Role-T-3','CL-Compliance-T-3','CL-NY',42,'\0','\0','COLUMN',NULL),('V-SDTM-AE-AEDECOD','AEDECOD','Dictionary-derived text description of AETERM or AEMODIFY. Equivalent to the Preferred Term (PT in MedDRA). The sponsor is sdtm-1-3:Classifier.ExpecedVariableected to provide the dictionary name and version used to map the terms utilizing the define.xml external codelist attributes.','string','Dictionary-Derived Term','D-SDTM-AE','CL-Role-T-4','CL-Compliance-T-1',NULL,12,'\0','\0','COLUMN',NULL),('V-SDTM-AE-AEDUR','AEDUR','Collected duration and unit of an adverse event. Used only if collected on the CRF and not derived from start and end date/times. Example: P1DT2H (for 1 day, 2 hours).','duration','Duration of Adverse Event','D-SDTM-AE','CL-Role-T-6','CL-Compliance-T-3',NULL,48,'\0','\0','COLUMN',NULL),('V-SDTM-AE-AEENDTC','AEENDTC','','dateTime','End Date/Time of Adverse Event','D-SDTM-AE','CL-Role-T-6','CL-Compliance-T-2',NULL,45,'\0','\0','COLUMN',NULL),('V-SDTM-AE-AEENDY','AEENDY','Study day of end of event relative to the sponsor-defined RFSTDTC.','integer','Study Day of End of Adverse Event','D-SDTM-AE','CL-Role-T-6','CL-Compliance-T-3',NULL,47,'\0','\0','COLUMN',NULL),('V-SDTM-AE-AEENRF','AEENRF','Describes the end of the event relative to the sponsor-defined reference period. The sponsor-defined reference period is a continuous period of time defined by a discrete starting point (RFSTDTC) and a discrete ending point (RFENDTC) of the trial.','string','End Relative to Reference Period','D-SDTM-AE','CL-Role-T-6','CL-Compliance-T-3','CL-STENRF',49,'\0','\0','COLUMN',NULL),('V-SDTM-AE-AEENRTPT','AEENRTPT','Identifies the end of the event as being before or after the reference time point defined by variable AEENTPT.','string','End Relative to Reference Time Point','D-SDTM-AE','CL-Role-T-6','CL-Compliance-T-3',NULL,50,'\0','\0','COLUMN',NULL),('V-SDTM-AE-AEENTPT','AEENTPT','Description of date/time in ISO 8601 character format of the reference point referred to by AEENRTPT. Examples: \"2003-12-25\" or \"VISIT 2\".','string','End Reference Time Point','D-SDTM-AE','CL-Role-T-6','CL-Compliance-T-3',NULL,51,'\0','\0','COLUMN',NULL),('V-SDTM-AE-AEGRPID','AEGRPID','Used to tie together a block of related records in a single domain for a subject.','string','Group ID','D-SDTM-AE','CL-Role-T-1','CL-Compliance-T-3',NULL,5,'\0','\0','COLUMN',NULL),('V-SDTM-AE-AEHLGT','AEHLGT','Dictionary-derived text description of the High Level Group Term for the primary System Organ Class.','string','High Level Group Term','D-SDTM-AE','CL-Role-T-5','CL-Compliance-T-2',NULL,16,'\0','\0','COLUMN',NULL),('V-SDTM-AE-AEHLGTCD','AEHLGTCD','Dictionary-derived code for the High Level Group Term for the primary System Organ Class.','decimal','High Level Group Term Code','D-SDTM-AE','CL-Role-T-5','CL-Compliance-T-2',NULL,17,'\0','\0','COLUMN',NULL),('V-SDTM-AE-AEHLT','AEHLT','Dictionary-derived text description of the High Level Term for the primary System Organ Class.','string','High Level Term','D-SDTM-AE','CL-Role-T-5','CL-Compliance-T-2',NULL,14,'\0','\0','COLUMN',NULL),('V-SDTM-AE-AEHLTCD','AEHLTCD','Dictionary-derived code for the High Level Term for the primary System Organ Class.','decimal','High Level Term Code','D-SDTM-AE','CL-Role-T-5','CL-Compliance-T-2',NULL,15,'\0','\0','COLUMN',NULL),('V-SDTM-AE-AELLT','AELLT','Dictionary-derived text description of the Lowest Level Term.','string','Lowest Level Term','D-SDTM-AE','CL-Role-T-5','CL-Compliance-T-2',NULL,10,'\0','\0','COLUMN',NULL),('V-SDTM-AE-AELLTCD','AELLTCD','Dictionary-derived code for the Lowest Level Term.','decimal','Lowest Level Term Code','D-SDTM-AE','CL-Role-T-5','CL-Compliance-T-2',NULL,11,'\0','\0','COLUMN',NULL),('V-SDTM-AE-AELOC','AELOC','Describes anatomical location relevant for the event (e.g., LEFT ARM for skin rash).','string','Location of Event','D-SDTM-AE','CL-Role-T-3','CL-Compliance-T-3','CL-LOC',25,'\0','\0','COLUMN',NULL),('V-SDTM-AE-AEMODIFY','AEMODIFY','If AETERM is modified to facilitate coding, then AEMODIFY will contain the modified text.','string','Modified Reported Term','D-SDTM-AE','CL-Role-T-4','CL-Compliance-T-3',NULL,9,'\0','\0','COLUMN',NULL),('V-SDTM-AE-AEOUT','AEOUT','Description of the outcome of an event.','string','Outcome of Adverse Event','D-SDTM-AE','CL-Role-T-3','CL-Compliance-T-3','CL-OUT',33,'\0','\0','COLUMN',NULL),('V-SDTM-AE-AEPATT','AEPATT','Used to indicate the pattern of the event over time. Examples: INTERMITTENT, CONTINUOUS, SINGLE EVENT.','string','Pattern of Adverse Event','D-SDTM-AE','CL-Role-T-3','CL-Compliance-T-3',NULL,32,'\0','\0','COLUMN',NULL),('V-SDTM-AE-AEPRESP','AEPRESP','A value of \"Y\" indicates that this adverse event was pre-specified on the CRF. Values are null for spontaneously reported events (i.e., those collected as free-text verbatim terms).','string','Pre-Specified Adverse Event','D-SDTM-AE','CL-Role-T-3','CL-Compliance-T-3','CL-NY',20,'\0','\0','COLUMN',NULL),('V-SDTM-AE-AEPTCD','AEPTCD','Dictionary-derived code for the Preferred Term.','decimal','Preferred Term Code','D-SDTM-AE','CL-Role-T-5','CL-Compliance-T-2',NULL,13,'\0','\0','COLUMN',NULL),('V-SDTM-AE-AEREFID','AEREFID','Internal or external identifier such as a serial number on an SAE reporting form.','string','Reference ID','D-SDTM-AE','CL-Role-T-1','CL-Compliance-T-3',NULL,6,'\0','\0','COLUMN',NULL),('V-SDTM-AE-AEREL','AEREL','Records the investigator\'s opinion as to the causality of the event to the treatment. ICH E2A and E2B examples include NOT RELATED, UNLIKELY RELATED, POSSIBLY RELATED, RELATED. Controlled Terminology may be defined in the future. Check with regulatory authority for population of this variable.','string','Causality','D-SDTM-AE','CL-Role-T-3','CL-Compliance-T-2',NULL,30,'\0','\0','COLUMN',NULL),('V-SDTM-AE-AERELNST','AERELNST','Records the investigator\'s opinion as to whether the event may have been due to a treatment other than study drug. May be reported as free text. Example: \"MORE LIKELY RELATED TO ASPIRIN USE.\"','string','Relationship to Non-Study Treatment','D-SDTM-AE','CL-Role-T-3','CL-Compliance-T-3',NULL,31,'\0','\0','COLUMN',NULL),('V-SDTM-AE-AESCAN','AESCAN','Was the serious event associated with the development of cancer?','string','Involves Cancer','D-SDTM-AE','CL-Role-T-3','CL-Compliance-T-3','CL-NY',34,'\0','\0','COLUMN',NULL),('V-SDTM-AE-AESCAT','AESCAT','A further categorization of adverse event. Example: NEUROLOGIC.','string','Subcategory for Adverse Event','D-SDTM-AE','CL-Role-T-7','CL-Compliance-T-3',NULL,19,'\0','\0','COLUMN',NULL),('V-SDTM-AE-AESCONG','AESCONG','Was the serious event associated with congenital anomaly or birth defect?','string','Congenital Anomaly or Birth Defect','D-SDTM-AE','CL-Role-T-3','CL-Compliance-T-3','CL-NY',35,'\0','\0','COLUMN',NULL),('V-SDTM-AE-AESDISAB','AESDISAB','Did the serious event result in persistent or significant disability/incapacity?','string','Persist or Signif Disability/Incapacity','D-SDTM-AE','CL-Role-T-3','CL-Compliance-T-3','CL-NY',36,'\0','\0','COLUMN',NULL),('V-SDTM-AE-AESDTH','AESDTH','Did the serious even