 of ARMCD values would be 20.','string','Planned Arm Code','D-SDTM-DM','CL-Role-T-3','CL-Compliance-T-1',NULL,22,'\0','\0','COLUMN',NULL),('V-SDTM-DM-BRTHDTC','BRTHDTC','Date/time of birth of the subject.','dateTime','Date/Time of Birth','D-SDTM-DM','CL-Role-T-3','CL-Compliance-T-3',NULL,16,'\0','\0','COLUMN',NULL),('V-SDTM-DM-COUNTRY','COUNTRY','Country of the investigational site in which the subject participated in the trial.','string','Country','D-SDTM-DM','CL-Role-T-3','CL-Compliance-T-1','CL-COUNTRY',26,'\0','\0','COLUMN',NULL),('V-SDTM-DM-DMDTC','DMDTC','Date/time of demographic data collection.','dateTime','Date/Time of Collection','D-SDTM-DM','CL-Role-T-6','CL-Compliance-T-3',NULL,27,'\0','\0','COLUMN',NULL),('V-SDTM-DM-DMDY','DMDY','Study day of collection measured as integer days.','integer','Study Day of Collection','D-SDTM-DM','CL-Role-T-6','CL-Compliance-T-3',NULL,28,'\0','\0','COLUMN',NULL),('V-SDTM-DM-DOMAIN','DOMAIN','Two-character abbreviation for the domain.','string','Domain Abbreviation','D-SDTM-DM','CL-Role-T-1','CL-Compliance-T-1',NULL,2,'\0','\0','COLUMN',NULL),('V-SDTM-DM-DTHDTC','DTHDTC','Date/time of death for any subject who died, in ISO 8601 format. Should represent the date/time that is captured in the clinical-trial database.','dateTime','Date/Time of Death','D-SDTM-DM','CL-Role-T-3','CL-Compliance-T-2',NULL,11,'\0','\0','COLUMN',NULL),('V-SDTM-DM-DTHFL','DTHFL','Indicates the subject died. Should be Y or null. Should be populated even when the death date is unknown.','string','Subject Death Flag','D-SDTM-DM','CL-Role-T-3','CL-Compliance-T-2','CL-NY',12,'\0','\0','COLUMN',NULL),('V-SDTM-DM-ETHNIC','ETHNIC','The ethnicity of the subject. Sponsors should refer to \"Collection of Race and Ethnicity Data in Clinical Trials\" (FDA, September 2005) for guidance regarding the collection of ethnicity (http://www.fda.gov/cder/guidance/5656fnl.htm).','string','Ethnicity','D-SDTM-DM','CL-Role-T-3','CL-Compliance-T-3','CL-ETHNIC',21,'\0','\0','COLUMN',NULL),('V-SDTM-DM-INVID','INVID','An identifier to describe the Investigator for the study. May be used in addition to SITEID. Not needed if SITEID is equivalent to INVID.','string','Investigator Identifier','D-SDTM-DM','CL-Role-T-3','CL-Compliance-T-3',NULL,14,'\0','\0','COLUMN',NULL),('V-SDTM-DM-INVNAM','INVNAM','Name of the investigator for a site.','string','Investigator Name','D-SDTM-DM','CL-Role-T-4','CL-Compliance-T-3',NULL,15,'\0','\0','COLUMN',NULL),('V-SDTM-DM-RACE','RACE','Race of the subject. Sponsors should refer to \"Collection of Race and Ethnicity Data in Clinical Trials\" (FDA, September 2005) for guidance regarding the collection of race (http://www.fda.gov/cder/guidance/5656fnl.htm) See Assumption below regarding RACE.','string','Race','D-SDTM-DM','CL-Role-T-3','CL-Compliance-T-2','CL-RACE',20,'\0','\0','COLUMN',NULL),('V-SDTM-DM-RFENDTC','RFENDTC','Reference End Date/time for the subject in ISO 8601 character format. Usually equivalent to the date/time when subject was determined to have ended the trial, and often equivalent to date/time of last sdtm-1-3:Classifier.ExpecedVariableosure to study treatment. sdtm-1-3:Classifier.RequiredVariableuired for all randomized subjects; null for screen failures or unassigned subjects.','dateTime','Subject Reference End Date/Time','D-SDTM-DM','CL-Role-T-3','CL-Compliance-T-2',NULL,6,'\0','\0','COLUMN',NULL),('V-SDTM-DM-RFICDTC','RFICDTC','Date/time of informed consent in ISO 8601 character format. This will be the same as the date of informed consent in the Disposition domain, if that protocol milestone is documented. Would be null only in studies not collecting the date of informed consent.','dateTime','Date/Time of Informed Consent','D-SDTM-DM','CL-Role-T-3','CL-Compliance-T-2',NULL,9,'\0','\0','COLUMN',NULL),('V-SDTM-DM-RFPENDTC','RFPENDTC','Date/time when subject ended participation or follow-up in a trial, as defined in the protocol, in ISO 8601 character format. Should correspond to the last known 