'\0','\0','COLUMN',NULL),('V-SDTM-SUPPQUAL-QNAM','QNAM','The short name of the Qualifier variable, which is used as a column name in a domain view with data from the parent domain. The value in QNAM cannot be longer than 8 characters, nor can it start with a number (e.g., \"1TEST\"). QNAM cannot contain characters other than letters, numbers, or underscores. This will often be the column name in the sponsor\'s operational dataset.','string','Qualifier Variable Name','D-SDTM-SUPPQUAL',NULL,'CL-Compliance-T-1',NULL,6,'\0','\0','COLUMN',NULL),('V-SDTM-SUPPQUAL-QORIG','QORIG','Since QVAL can represent a mixture of collected (on a CRF), derived, or assigned items, QORIG is used to indicate the origin of this data. Examples include CRF, ASSIGNED, or DERIVED. See Section 4.1.1.8.','string','Origin','D-SDTM-SUPPQUAL',NULL,'CL-Compliance-T-1',NULL,9,'\0','\0','COLUMN',NULL),('V-SDTM-SUPPQUAL-QVAL','QVAL','Result of, response to, or value associated with QNAM. A value for this column is sdtm-1-3:Classifier.RequiredVariableuired; no records can be in SUPP-- with a null value for QVAL.','string','Data Value','D-SDTM-SUPPQUAL',NULL,'CL-Compliance-T-1',NULL,8,'\0','\0','COLUMN',NULL),('V-SDTM-SUPPQUAL-RDOMAIN','RDOMAIN','Two-character abbreviation for the domain of the parent record(s).','string','Related Domain Abbreviation','D-SDTM-SUPPQUAL',NULL,'CL-Compliance-T-1',NULL,2,'\0','\0','COLUMN',NULL),('V-SDTM-SUPPQUAL-STUDYID','STUDYID','Study Identifier of the Parent record(s).','string','Study Identifier','D-SDTM-SUPPQUAL',NULL,'CL-Compliance-T-1',NULL,1,'\0','\0','COLUMN',NULL),('V-SDTM-SUPPQUAL-USUBJID','USUBJID','Unique Subject Identifier of the Parent record(s).','string','Unique Subject Identifier','D-SDTM-SUPPQUAL',NULL,'CL-Compliance-T-1',NULL,3,'\0','\0','COLUMN',NULL),('V-SDTM-SV-DOMAIN','DOMAIN','Two-character abbreviation for the domain.','string','Domain Abbreviation','D-SDTM-SV','CL-Role-T-1','CL-Compliance-T-1',NULL,2,'\0','\0','COLUMN',NULL),('V-SDTM-SV-STUDYID','