resents the date of the scan/image/physical exam not the date that the image was read to identify tumors.  TRDTC variable does not represent the VISIT date.','dateTime','Date/Time of Tumor Measurement','D-SDTM-TR','CL-Role-T-6','CL-Compliance-T-2',NULL,28,'\0','\0','COLUMN',NULL),('V-SDTM-TR-TRDY','TRDY','1. Study day of the scan/image/physical exam, measured as integer days.   2. Algorithm for calculations must be relative to the sponsor-defined RFSTDTC variable in Demographics.','integer','Study Day of Tumor Measurement','D-SDTM-TR','CL-Role-T-6','CL-Compliance-T-3',NULL,29,'\0','\0','COLUMN',NULL),('V-SDTM-TR-TREVAL','TREVAL','Role of the person who provided the evaluation. Examples: INVESTIGATOR, INDEPENDENT ASSESSOR.  This column can be left Null when the Investigator provides the complete set of data in the domain. However the column should contain no Null values when data from one or more independent assessors is included meaning that the rows attributed to the Investigator should contain a value of INVESTIGATOR.','string','Evaluator','D-SDTM-TR','CL-Role-T-3','CL-Compliance-T-2','CL-EVAL',21,'\0','\0','COLUMN',NULL),('V-SDTM-TR-TREVALID','TREVALID','The Evaluator Specified variable is used in conjunction with TREVAL to provide an additional level of detail. When multiple assessors play the role identified in TREVAL, values of TREVALID will attribute a row of data to a particular assessor. TREVALID should not contain the names of the assessors, or a code identifier for a specific assessor,  but should contain values such as RADIOLOGIST, RADIOLOGIST 1 or RADIOLOGIST 2. The TREVALID variable is subject to CDISC Controlled Terminology. Note TREVAL must also be populated when TREVALID is populated.  See Assumption 7.','string','Evaluator Identifier','D-SDTM-TR','CL-Role-T-5','CL-Compliance-T-3','CL-MEDEVAL',22,'\0','\0','COLUMN',NULL),('V-SDTM-TR-TRGRPID','TRGRPID','Used to link together a block of related records within a subject in a domain.','string','Group ID