,'COLUMN',NULL),('V-SDTM-TU-TUDY','TUDY','1. Study day of the scan/image/physical exam, measured as integer days.  2. Algorithm for calculations must be relative to the sponsor-defined RFSTDTC variable in Demographics.','integer','Study Day of Tumor Identification','D-SDTM-TU','CL-Role-T-6','CL-Compliance-T-3',NULL,27,'\0','\0','COLUMN',NULL),('V-SDTM-TU-TUEVAL','TUEVAL','Role of the person who provided the evaluation. Examples: INVESTIGATOR, INDEPENDNT ASSESSOR  This column can be left Null when the Investigator provides the complete set of data in the domain. However the column should contain no Null values when data from one or more independent assessors is included meaning that the rows attributed to the Investigator should contain a value of INVESTIGATOR.','string','Evaluator','D-SDTM-TU','CL-Role-T-3','CL-Compliance-T-2','CL-EVAL',19,'\0','\0','COLUMN',NULL),('V-SDTM-TU-TUEVALID','TUEVALID','The Evaluator Specified variable is used in conjunction with TUEVAL to provide an additional level of detail. When multiple assessors play the role identified in TUEVAL, values of TUEVALID will attribute a row of data to a particular assessor. TUEVALID should not contain the names of the assessors, or a code identifier for a specific assessor, but should contain values such as RADIOLOGIST, RADIOLOGIST 1 or RADIOLOGIST 2. The TUEVALID is subject to CDISC Controlled Terminology. See Assumption 7.','string','Evaluator Identifier','D-SDTM-TU','CL-Role-T-5','CL-Compliance-T-3','CL-MEDEVAL',20,'\0','\0','COLUMN',NULL),('V-SDTM-TU-TUGRPID','TUGRPID','Used to link together a block of related records within a subject in a domain.  Can be used to group split or merged tumors which have been identified.','string','Group ID','D-SDTM-TU','CL-Role-T-1','CL-Compliance-T-3',NULL,5,'\0','\0','COLUMN',NULL),('V-SDTM-TU-TULAT','TULAT','Qualifier for anatomical location or specimen further detailing laterality, for example, LEFT, RIGHT, BILATERAL.','string','Laterality','D-SDTM-TU','CL-Role-T-3','CL-Compliance-T-3','CL-LAT',15,'\0','\0','COLUMN',NULL),('V-SDTM-TU-TULNKID','TULNKID','Identifier used to link identified tumors to the assessment results (in TR domain) over the course of the study.','string','Link ID','D-SDTM-TU','CL-Role-T-1','CL-Compliance-T-2',NULL,8,'\0','\0','COLUMN',NULL),('V-SDTM-TU-TULOC','TULOC','Used to specify the anatomical location of the identified tumor. Example: LIVER  Note: When anatomical location is broken down and collected as distinct pieces of data that when combined provide the overall location information (e.g. laterality /directionality / distribution) then the additional anatomical location qualifiers should be used. See Assumption 3.','string','Location of the Tumor','D-SDTM-TU','CL-Role-T-3','CL-Compliance-T-2','CL-LOC',14,'\0','\0','COLUMN',NULL),('V-SDTM-TU-TUMETHOD','TUMETHOD','Method used to identify the tumor. Examples:  MRI, CT SCAN.','string','Method of Identification','D-SDTM-TU','CL-Role-T-3','CL-Compliance-T-2','CL-METHOD',18,'\0','\0','COLUMN',NULL),('V-SDTM-TU-TUNAM','TUNAM','The name or identifier of the vendor that performed the Tumor Identification.  This column can be left Null when the Investigator provides the complete set of data in the domain.','string','Vendor Name','D-SDTM-TU','CL-Role-T-3','CL-Compliance-T-3',NULL,13,'\0','\0','COLUMN',NULL),('V-SDTM-TU-TUORRES','TUORRES','Result of the Tumor identification.  The result of tumor identification is a classification of identified tumor.  Examples: When TUTESTCD=TUMIDENT (Tumor Identification), values of TUORRES might be: TARGET, NON-TARGET, or NEW, or BENIGN ABNORMALITY.','string','Tumor Identification Result','D-SDTM-TU','CL-Role-T-8','CL-Compliance-T-2',NULL,11,'\0','\0','COLUMN',NULL),('V-SDTM-TU-TUPORTOT','TUPORTOT','Qualifier for anatomical location or specimen further detailing the distribution which means arrangement of, or apportioning of, for example, ENTIRE, SINGLE, SEGMENT, MANY.','string','Portion or Totality','D-SDTM-TU','CL-Role-T