 May be used in addition to VISITNUM and/or VISITDY.','string','Visit Name','D-SDTM-TU','CL-Role-T-6','CL-Compliance-T-3',NULL,23,'\0','\0','COLUMN',NULL),('V-SDTM-TU-VISITDY','VISITDY','','integer','Planned Study Day of Visit','D-SDTM-TU','CL-Role-T-6','CL-Compliance-T-3',NULL,24,'\0','\0','COLUMN',NULL),('V-SDTM-TU-VISITNUM','VISITNUM','1. Clinical encounter number.  2. Numeric version of VISIT, used for sorting.','decimal','Visit Number','D-SDTM-TU','CL-Role-T-6','CL-Compliance-T-2',NULL,22,'\0','\0','COLUMN',NULL),('V-SDTM-TV-ARM','ARM','1. Name given to an Arm or Treatment Group.\n2. If the timing of Visits for a trial does not depend on which Arm a subject is in, then Arm should be left blank.','string','Description of Planned Arm','D-SDTM-TV','CL-Role-T-4','CL-Compliance-T-3',NULL,7,'\0','\0','COLUMN',NULL),('V-SDTM-TV-ARMCD','ARMCD','1.ARMCD is limited to 20 characters and does not have special character restrictions. The maximum length of ARMCD is longer than for other \"short\" variables to accommodate the kind of values that are likely to be needed for crossover trials. For example, if ARMCD values for a seven-period crossover were constructed using two-character abbreviations for each treatment and separating hyphens, the length of ARMCD values would be 20.\n2. If the timing of Visits for a trial does not depend on which ARM a subject is in, then ARMCD should be null.','string','Planned Arm Code','D-SDTM-TV','CL-Role-T-3','CL-Compliance-T-2',NULL,6,'\0','\0','COLUMN',NULL),('V-SDTM-TV-DOMAIN','DOMAIN','Two-character abbreviation for the domain.','string','Domain Abbreviation','D-SDTM-TV','CL-Role-T-1','CL-Compliance-T-1',NULL,2,'\0','\0','COLUMN',NULL),('V-SDTM-TV-STUDYID','STUDYID','Unique identifier for a study.','string','Study Identifier','D-SDTM-TV','CL-Role-T-1','CL-Compliance-T-1',NULL,1,'\0','\0','COLUMN',NULL),('V-SDTM-TV-TVENRL','TVENRL','Rule describing when the Visit ends, in relation to the sequence of Elements.','string','Visit End Rule','D