teger','Planned Study Day of Visit','D-SDTM-VS','CL-Role-T-6','CL-Compliance-T-3',NULL,24,'\0','\0','COLUMN',NULL),('V-SDTM-VS-VISITNUM','VISITNUM','1. Clinical encounter number.\n2. Numeric version of VISIT, used for sorting.','decimal','Visit Number','D-SDTM-VS','CL-Role-T-6','CL-Compliance-T-2',NULL,22,'\0','\0','COLUMN',NULL),('V-SDTM-VS-VSBLFL','VSBLFL','Indicator used to identify a baseline value. The value should be \"Y\" or null.','string','Baseline Flag','D-SDTM-VS','CL-Role-T-3','CL-Compliance-T-2','CL-NY',20,'\0','\0','COLUMN',NULL),('V-SDTM-VS-VSCAT','VSCAT','Used to define a category of related records.','string','Category for Vital Signs','D-SDTM-VS','CL-Role-T-7','CL-Compliance-T-3',NULL,9,'\0','\0','COLUMN',NULL),('V-SDTM-VS-VSDRVFL','VSDRVFL','Used to indicate a derived record. The value should be Y or null. Records which represent the average of other records or which do not come from the CRF are examples of records that would be derived for the submission datasets. If VSDRVFL=Y, then VSORRES may be null, with VSSTRESC and (if numeric) VSSTRESN having the derived value.','string','Derived Flag','D-SDTM-VS','CL-Role-T-3','CL-Compliance-T-3','CL-NY',21,'\0','\0','COLUMN',NULL),('V-SDTM-VS-VSDTC','VSDTC','','dateTime','Date/Time of Measurements','D-SDTM-VS','CL-Role-T-6','CL-Compliance-T-2',NULL,25,'\0','\0','COLUMN',NULL),('V-SDTM-VS-VSDY','VSDY','1. Study day of vital signs measurements, measured as integer days.\n2. Algorithm for calculations must be relative to the sponsor-defined RFSTDTC variable in Demographics.','integer','Study Day of Vital Signs','D-SDTM-VS','CL-Role-T-6','CL-Compliance-T-3',NULL,26,'\0','\0','COLUMN',NULL),('V-SDTM-VS-VSELTM','VSELTM','Planned Elapsed time (in ISO 8601) relative to a planned fixed reference (VSTPTREF). This variable is useful where there are repetitive measures. Not a clock time or a date time variable. Represented as an ISO 8601 Duration. Examples: \"-PT15M\" to represent the period of 15 minutes prior to the reference point indicated by VSTPTREF, or \"PT8H\" to represent the period of 8 hours after the reference point indicated by VSTPTREF.','duration','Planned Elapsed Time from Time Point Ref','D-SDTM-VS','CL-Role-T-6','CL-Compliance-T-3',NULL,29,'\0','\0','COLUMN',NULL),('V-SDTM-VS-VSGRPID','VSGRPID','Used to tie together a block of related records in a single domain for a subject.','string','Group ID','D-SDTM-VS','CL-Role-T-1','CL-Compliance-T-3',NULL,5,'\0','\0','COLUMN',NULL),('V-SDTM-VS-VSLOC','VSLOC','Location relevant to the collection of Vital Signs measurement. Example: LEFT ARM for blood pressure.','string','Location of Vital Signs Measurement','D-SDTM-VS','CL-Role-T-3','CL-Compliance-T-3','CL-LOC',19,'\0','\0','COLUMN',NULL),('V-SDTM-VS-VSNRIND','VSNRIND','1. Indicates where the value falls with respect to reference range defined by VSORNRLO and VSORNRHI, VSSTNRLO and VSSTNRHI, or by VSSTNRC. Examples: NORMAL, ABNORMAL, HIGH, LOW.\r 2. Sponsors should specify in the study metadata (Comments column in the define.xml) whether VSNRIND refers to the original or standard reference ranges and results.\r 3. Should not be used to indicate clinical significance.','string','Reference Range Indicator','D-SDTM-VS','CL-Role-T-5','CL-Compliance-T-2',NULL,22,'\0','\0','COLUMN',NULL),('V-SDTM-VS-VSORNRHI','VSORNRHI','Upper end of reference range for continuous measurements in original units. Should be populated only for continuous results.','string','Reference Range Upper Limit in Orig Unit','D-SDTM-VS','CL-Role-T-5','CL-Compliance-T-2',NULL,15,'\0','\0','COLUMN',NULL),('V-SDTM-VS-VSORNRLO','VSORNRLO','Lower end of reference range for continuous measurements in original units. Should be populated only for continuous results.','string','Reference Range Lower Limit in Orig Unit','D-SDTM-VS','CL-Role-T-5','CL-Compliance-T-2',NULL,14,'\0','\0','COLUMN',NULL),('V-SDTM-VS-VSORRES','VSORRES','Result of the vital signs measurement as originally received or collected.','string','Result or Finding in Original Units','D-SDTM-VS','CL-Role-T-8','CL-Compliance-T-2',NULL,12,'\0','\0','COLUMN',NULL),('V-SDTM-VS-VSORRESU','VSORRESU','Original units in which the data were collected. The unit for VSORRES. Examples: IN, LB, BEATS/MIN.','string','Original Units','D-SDTM-VS','CL-Role-T-5','CL-Compliance-T-2','CL-VSRESU',13,'\0','\0','COLUMN',NULL),('V-SDTM-VS-VSPOS','VSPOS','Position of the subject during a measurement or examination. Examples: SUPINE, STANDING, SITTING.','string','Vital Signs Position of Subject','D-SDTM-VS','CL-Role-T-3','CL-Compliance-T-3','CL-POSITION',11,'\0','\0','COLUMN',NULL),('V-SDTM-VS-VSREASND','VSREASND','Describes why a measurement or test was not performed. Examples: BROKEN EQUIPMENT or SUBJECT REFUSED. Used in conjunction with VSSTAT when value is NOT DONE.','string','Reason Not Performed','D-SDTM-VS','CL-Role-T-3','CL-Compliance-T-3',NULL,18,'\0','\0','COLUMN',NULL),('V-SDTM-VS-VSRFTDTC','VSRFTDTC','Date/time of the reference time point, LBTPTREF.','dateTime','Date/Time of Reference Time Point','D-SDTM-VS','CL-Role-T-6','CL-Compliance-T-3',NULL,31,'\0','\0','COLUMN',NULL),('V-SDTM-VS-VSSCAT','VSSCAT','A further categorization of a measurement or examination.','string','Subcategory for Vital Signs','D-SDTM-VS','CL-Role-T-7','CL-Compliance-T-3',NULL,10,'\0','\0','COLUMN',NULL),('V-SDTM-VS-VSSEQ','VSSEQ','Sequence Number given to ensure uniqueness of subject records within a domain. May be any valid number.','decimal','Sequence Number','D-SDTM-VS','CL-Role-T-1','CL-Compliance-T-1',NULL,4,'\0','\0','COLUMN',NULL),('V-SDTM-VS-VSSPID','VSSPID','Sponsor-defined reference number. Perhaps pre-printed on the CRF as an sdtm-1-3:Classifier.ExpecedVariablelicit line identifier or defined in the sponsor\'s operational database.','string','Sponsor-Defined Identifier','D-SDTM-VS','CL-Role-T-1','CL-Compliance-T-3',NULL,6,'\0','\0','COLUMN',NULL),('V-SDTM-VS-VSSTAT','VSSTAT','Used to indicate that a vital sign measurement was not done. Should be null if a result exists in VSORRES.','string','Completion Status','D-SDTM-VS','CL-Role-T-3','CL-Compliance-T-3','CL-ND',17,'\0','\0','COLUMN',NULL),('V-SDTM-VS-VSSTNRHI','VSSTNRHI','Upper end of reference range for continuous measurements in standardized units. Should be populated only for continuous results.','decimal','Reference Range Upper Limit-Std Units','D-SDTM-VS','CL-Role-T-5','CL-Compliance-T-2',NULL,20,'\0','\0','COLUMN',NULL),('V-SDTM-VS-VSSTNRLO','VSSTNRLO','Lower end of reference range for continuous measurements for VSSTRESC/VSSTRESN in standardized units. Should be populated only for continuous results.','decimal','Reference Range Lower Limit-Std Units','D-SDTM-VS','CL-Role-T-5','CL-Compliance-T-2',NULL,19,'\0','\0','COLUMN',NULL),('V-SDTM-VS-VSSTRESC','VSSTRESC','Contains the result value for all findings, copied or derived from VSORRES in a standard format or standard units. VSSTRESC should store all results or findings in character format; if results are numeric, they should also be stored in numeric format in VSSTRESN. For example, if a test has results \"NONE\", \"NEG\", and \"NEGATIVE\" in VSORRES and these results effectively have the same meaning, they could be represented in standard format in VSSTRESC as \"NEGATIVE\".','string','Character Result/Finding in Std Format','D-SDTM-VS','CL-Role-T-8','CL-Compliance-T-2',NULL,14,'\0','\0','COLUMN',NULL),('V-SDTM-VS-VSSTRESN','VSSTRESN','Used for continuous or numeric results or findings in standard format; copied in numeric format from VSSTRESC. VSSTRESN should store all numeric test results or findings.','decimal','Numeric Result/Finding in Standard Units','D-SDTM-VS','CL-Role-T-8','CL-Compliance-T-2',NULL,15,'\0','\0','COLUMN',NULL),('V-SDTM-VS-VSSTRESU','VSSTRESU','Standardized unit used for VSSTRESC and VSSTRESN.','string','Standard Units','D-SDTM-VS','CL-Role-T-5','CL-Compliance-T-2','CL-VSRESU',16,'\0','\0','COLUMN',NULL),('V-SDTM-VS-VSTEST','VSTEST','Verbatim name of the test or examination used to obtain the measurement or finding. The value in VSTEST cannot be longer than 40 characters. Examples: Systolic Blood Pressure, Diastolic Blood Pressure, Body Mass Index.','string','Vital Signs Test Name','D-SDTM-VS','CL-Role-T-4','CL-Compliance-T-1','CL-VSTEST',8,'\0','\0','COLUMN',NULL),('V-SDTM-VS-VSTESTCD','VSTESTCD','Short name of the measurement, test, or examination described in VSTEST. It can be used as a column name when converting a dataset from a vertical to a horizontal format. The value in VSTESTCD cannot be longer than 8 characters, nor can it start with a number (e.g.\"1TEST\"). VSTESTCD cannot contain characters other than letters, numbers, or underscores. Examples: SYSBP, DIABP, BMI.','string','Vital Signs Test Short Name','D-SDTM-VS','CL-Role-T-2','CL-Compliance-T-1','CL-VSTESTCD',7,'\0','\0','COLUMN',NULL),('V-SDTM-VS-VSTPT','VSTPT','1. Text Description of time when measurement should be taken.\n2. This may be represented as an elapsed time relative to a fixed reference point, such as time of last dose. See VSTPTNUM and VSTPTREF. Examples: Start, 5 min post.','string','Planned Time Point Name','D-SDTM-VS','CL-Role-T-6','CL-Compliance-T-3',NULL,27,'\0','\0','COLUMN',NULL),('V-SDTM-VS-VSTPTNUM','VSTPTNUM','Numerical version of VSTPT to aid in sorting.','decimal','Planned Time Point Number','D-SDTM-VS','CL-Role-T-6','CL-Compliance-T-3',NULL,28,'\0','\0','COLUMN',NULL),('V-SDTM-VS-VSTPTREF','VSTPTREF','Name of the fixed reference point referred to by VSELTM, VSTPTNUM, and VSTPT. Examples: PREVIOUS DOSE, PREVIOUS MEAL.','string','Time Point Reference','D-SDTM-VS','CL-Role-T-6','CL-Compliance-T-3',NULL,30,'\0','\0','COLUMN',NULL);
